tables.table_schema:
CREATE TABLE wrestling_events (
  event_id INT PRIMARY KEY,
  event_name VARCHAR(255),
  event_date DATE
);

CREATE TABLE wrestling_matches (
  match_id INT PRIMARY KEY,
  event_id INT,
  match_type VARCHAR(50),
  winner VARCHAR(100)
);

CREATE TABLE WrestlingEvents (
 event_id INT PRIMARY KEY,
 event_name VARCHAR(255),
 event_date DATE
);

CREATE TABLE WrestlingEvents (
    event_id INT,
    event_name VARCHAR(50),
    event_date DATE,
    venue VARCHAR(50)
);

CREATE TABLE Fans (
    fan_id INT,
    fan_name VARCHAR(50),
    fan_email VARCHAR(50),
    fan_location VARCHAR(50)
);

CREATE TABLE EventFeedback (
    event_id INT PRIMARY KEY,
    event_name VARCHAR(255),
    feedback_text TEXT,
    rating INT
);

CREATE TABLE Wrestler (
    wrestler_id INT PRIMARY KEY,
    wrestler_name VARCHAR(255),
    age INT,
    weight INT
);

CREATE TABLE Venue (
    venue_id INT PRIMARY KEY,
    venue_name VARCHAR(255),
    location VARCHAR(255),
    capacity INT
);
